function switchHomeLayout(){const a=document.getElementById("page"),b=document.getElementById("profile"),c=document.querySelectorAll("code[id=layout]"),d=cloudinary.Cloudinary.new({cloud_name:"paulportfolio"});d.responsive(),a.style.display==="none"?(a.style.display="block",b.style.display="none",c.forEach(function(a){a.innerText="page"})):(a.style.display="none",b.style.display="block",c.forEach(function(a){a.innerText="profile"}))}window.addEventListener("DOMContentLoaded",a=>{document.querySelectorAll("#switch-layout-button").forEach(a=>a.addEventListener("click",function(a){a.preventDefault(),switchHomeLayout()}))})